addFieldsToUrl.code:
function addFieldsToUrl(namespace, ids) {
    let str = '';
    if (namespace) str += 'namespace='+namespace;

    for (let i = 0; i < ids.length; i++){
        str += '&ids='+ids[i];
    }

    return str;
}

transformArray.code:
function transformArray(arr) {
	var result = {};
    if (
        typeof arr === "object" &&
        arr.length !== 0 
    )
        arr.forEach(pair => {
            result[pair.fieldName] = pair.fieldValue
        })
    return result
}

deleteObjIfEmpty.code:
function deleteObjIfEmpty(obj) {
	if (Object.keys(obj).length === 0) return undefined;
	else return obj;
}

formatFilterQuery.code:
function formatFilterQuery(str) {
    try {
        return JSON.parse(str)
    }
    catch (e) {
        throw new Error("JSON representation of the filter query is invalid.");
    }
}

formatUpserVectors.code:
function formatUpserVectors(arr) {
    if (arr && Array.isArray(arr) && arr.length > 0){
        for (let i = 0; i < arr.length; i++){
            arr[i].sparseVector = iml.deleteObjIfEmpty(arr[i].sparseVector);
            arr[i].metadata = iml.deleteObjIfEmpty(iml.transformArray(arr[i].metadata));
        }
    }
    return arr;
}
